//@ts-nocheck
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import React from 'react';
import RadarChartV from './RadarChart';

type cardprops = {
  RadarChartData?:any
  title?: string;
  description?: string;
  children?: React.ReactNode;
  cardData?: {
    header?: string;
    title?: string;
    description?: string;
    icon?: string;
    backgroundColor?: string;
  }[];
  titleStyles?: any;
  subtitleStyles?: any;
  ContentHeaderStyles?: any;
  ContentTitleStyles?: any;
  ContentDescriptionStyles?: any;
  ContentIconStyles?: any;
};
const LastCardV = (props: cardprops) => {
  const _getCards = () => {
    const _tempData: any = [];
    // eslint-disable-next-line no-unused-expressions
    Array.isArray(props?.cardData) &&
      props?.cardData.forEach(item => {
        const i = 0;
        _tempData.push(
          <Grid item xs={12} sm={6} md={3}>
            <Paper
              style={{
                padding: 10,
                textAlign: 'center',
              }}
            >
          <div style={{height:"500px"}}>
  <RadarChartV RadarChartData={props?.RadarChartData}/>

        </div>
            </Paper>
          </Grid>,
        );
      });
    return _tempData;
  };
  return (
    <Grid container justify={'center'} alignItems={'center'}>
      <Grid container spacing={3} style={{background: '#eeee'}}>
        {_getCards()}
      </Grid>
    </Grid>
  );
};
export default LastCardV;
